import React from 'react';


const ListProgress = (props) =>{
  return(
      <div>
          <h2>List Progress</h2>
             <ProgressBar/>
            <h4>Female Users</h4>
            <h4>Male Users</h4>
          
      </div>
  )
}

export default ListProgress;
